You can also use the `Filesystem::new_directory` function to create a new directory at a specific path. This function takes a path string as a parameter and returns a Result type with the `Filesystem` object if successful, or an error if any occurred. You can use the `Filesystem::new_directory` function to create directories at any level of the file system hierarchy. Here's an example of how to use the `Filesystem::new_directory` function to create a directory at a specific path:

```rust
use std::path::Path;
use filesys::Filesystem;

fn main() -> Result<(), Box<dyn std::error::Error>> {
    let mut filesystem = Filesystem::new()?;
    let path = Path::new("/home/user/Documents/mydirectory");
    filesystem.new_directory(path)?;
    Ok(())
}
```

This code creates a new directory at the path "/home/user/Documents/mydirectory"

